import './Story.css';

const Story = () => {
	return (
		<section className="story-section">
		<div className="container-fluid">
			<div className="row">
				<div className="col-12 col-md-6 col-lg-6 col-xl-6">

				</div>
				<div className="col-12 col-md-6 col-lg-6 col-xl-6">

				</div>
			</div>
		</div>			
		</section>
	);
}

export default Story;
